function update() {
    if (!this.target || !this.target.undoState) return;
    var undoState = this.target.undoState;
    if (this.undoMorphs) this.undoMorphs.invoke('remove');
    this.undoMorphs = [];
    undoState.undos.forEach(function(undo, i) {
        this.showUndo(undo, undoState.undos[i-1]);
    }, this);
    this.undoMorphs[this.target.undoState.idx-1].applyStyle({
        borderColor: Color.red,
        borderWidth: 2
    });
}

227.source:
function showUndo(undo, lastUndo) {
    var bnds = new Rectangle(0,this.innerBounds().bottom(), 100, 20);
    var text = new lively.morphic.Text(bnds, '');
    this.addMorph(text);
    this.undoMorphs.push(text);
    text.applyStyle({resizeWidth: true, clipMode: 'auto'});
    text.textString = 'undo';
    if (lastUndo) {
        text.diff(undo.richText.textString, lastUndo.richText.textString);
    }
}

